import styled from 'styled-components';

export const Form = styled.form`
  display: 'flex';
`;

export const InputBox = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
  width: 300px;
`;

export const LabelStyled = styled.label`
  display: flex;
  flex-direction: column;
  gap: 5px;
`;

export const InputStyled = styled.input`
  height: 15px;
`;
